// src/pages/DonoList.jsx
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

export default function DonoList() {
  const [donos, setDonos] = useState([]);

  useEffect(() => {
    api.get('/donos').then((res) => {
      setDonos(res.data);
    });
  }, []);

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between mb-3">
        <h2>Donos Cadastrados</h2>
        <div>
          <Link to="/" className="btn btn-secondary me-2">← Voltar ao Início</Link>
          <Link to="/donos/novo" className="btn btn-primary">+ Cadastrar Novo Dono</Link>
        </div>
      </div>

      {donos.map((dono) => (
        <div key={dono._id} className="mb-2 p-2 border rounded">
          <Link
            to={`/donos/${dono._id}`}
            style={{ textDecoration: 'none', color: 'inherit' }}
          >
            <strong>{dono.nome}</strong> – CPF: {dono.cpf}
          </Link>
        </div>
      ))}
    </div>
  );
}
